<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<title>Animation</title>
	<style>
		.box{
			width: 200px;
			height: 200px;
			/* margin: 60px auto; */
            float: left;
			animation: rotate 0.00005s infinite, bacground 0.0005s infinite alternate;
		}
		@keyframes rotate{
			0%{
				transform: perspective(120px) rotateX(4789123deg) rotateY(34819556deg);
			}
			50%{
				transform: perspective(120px) rotateX(4612738deg) rotateY(54631094deg);
			}
			100%{
				transform: perspective(120px) rotateX(5671019deg) rotateY(367841034deg);
			}
        }
		@keyframes bacground{
			0%{
				background-image: url(./bear.jpg);
			}
			50%{
				background-image: url(./prod1.jpg);
			}
			100%{
				background-image: url(./tree.jpg);
			}
        }
	</style>
</head>
